import { StatusBar } from 'expo-status-bar';
import { PaperProvider, useTheme } from "react-native-paper";
import { View } from 'react-native';
import { createStackNavigator } from "@react-navigation/stack";
import { NavigationContainer } from "@react-navigation/native";
import {Screens} from './types'
import TodoList from './screens/TodoListScreen'

const Stack = createStackNavigator();

const TodoDetails = () => {
  return (<View>Todo Details</View>)
}

const APP_TITLE = 'Achieve'

const makeTitle = (subTitle?:string) => {
  if (!subTitle) {
    return APP_TITLE;
  }

  return `${APP_TITLE} - ${subTitle}`
}

const NavigationStack = () => {
  return (
    <Stack.Navigator screenOptions={{ headerShown: false }}>
      <Stack.Screen name={TodoList.name} options={{ title: makeTitle(TodoList.subTitle) }} component={TodoList.screen} />
      <Stack.Screen name={Screens.TodoDetails} component={TodoDetails} />
    </Stack.Navigator>
  );
};

export default function App() {

  const theme = useTheme();

  return (
    <PaperProvider> 
      <StatusBar
        style="dark"
        backgroundColor={theme.colors.inversePrimary}
        translucent={false}
      />
      <NavigationContainer>
        <NavigationStack />
      </NavigationContainer>
    </PaperProvider>
  );
}
